            VHALI_GW_NMAcknowledge = CAN_Get_MsgDataValue(CAN3, CHANNEL_32, 13, 1);/**//*Offset:0.000000*//*Factor:1.000000*/
            VHALI_NMAcknowledge = VHALI_GW_NMAcknowledge;
