unsigned long SignalConvert_Physical_Raw_withInvalidVal(float phy, float gain, float offset, unsigned long min, unsigned long max, unsigned long InvalidValue)
{
    unsigned long tmp = 0;

    if( (unsigned long)phy == InvalidValue )
    {
        return InvalidValue;
    }
    tmp = (unsigned long)((phy - offset) / gain);
    if( tmp > max )
    {
        return max;
    }
    if( tmp < min )
    {
        return min;
    }

    return tmp;
}
unsigned long SignalConvert_Physical_Raw(float phy, float gain, float offset, unsigned long min, unsigned long max)
{
    unsigned long tmp = 0;

    tmp = (unsigned long)((phy - offset) / gain);
    if( tmp > max )
    {
        return max;
    }
    if( tmp < min )
    {
        return min;
    }

    return tmp;
}
float DataConvert_Roundf(float para)
{
    float temp = 0.0F;

    if( para >= 0.5F )
    {
        temp = (float)floor(para + 0.5F);
    }
    else if( para > -0.5F )
    {
        temp = para * 0.0F;
    }
    else
    {
        temp = (float)ceil(para - 0.5F);
    }

    return temp;
}
unsigned long SignalConvertRound_Physical_Raw_withInvalidVal(float phy, float gain, float offset, unsigned long min, unsigned long max, unsigned long InvalidValue)
{
    unsigned long tmp = 0;

    if( (unsigned long)phy == InvalidValue )
    {
        return InvalidValue;
    }
    tmp = (unsigned long)(DataConvert_Roundf((phy - offset) / gain));
    if( tmp > max )
    {
        return max;
    }
    if( tmp < min )
    {
        return min;
    }

    return tmp;
}

