void CANDBC_gather(CAN_CHANNEL CanChannel, CHANNEL Channel)
{
     DOM_PrepareSignals();
     if( S11_Mark == Vehicle_Type )
     {
         S11_PrepareMessages(CanChannel, Channel);
     }
     else if( S11P01_Mark == Vehicle_Type )
     {
         S11P01_PrepareMessages(CanChannel, Channel);
     }
     else if( A11_Mark == Vehicle_Type )
     {
         VHALI_MCUElecMotSpd = VHALI_A11MCUElecMotSpd;
         A11_PrepareMessages(CanChannel, Channel);
     }
     else if( S11P03_Mark == Vehicle_Type )
     {
         S11P03_PrepareMessages(CanChannel, Channel);
     }
     else if( S11P04_Mark == Vehicle_Type )
     {
         S11P04_PrepareMessages(CanChannel, Channel);
     }
     else if( S11P05_Mark == Vehicle_Type )
     {
         S11P05_PrepareMessages(CanChannel, Channel);
     }
     else if( S21_Mark == Vehicle_Type )
     {
         S21_PrepareMessages(CanChannel, Channel);
     }
     else if( (K11P01_Mark == Vehicle_Type) || (K11_Mark == Vehicle_Type) )
     {
         K11P01_PrepareMessages(CanChannel, Channel);
     }
     else	//默认S11
     {
         S11_PrepareMessages(CanChannel, Channel);
     }
}

