/******************************************************		基础解析和组装函数		*********************************************************/
uint32_t CAN_GetValue(uint8_t *Buff, uint8_t start, uint8_t length)
{
    unsigned char for_tick = 0, remain_length = 0;
    unsigned long Buff_taked = 0;
    unsigned long Value_Max = 1;

    if( length <= (8 - start % 8) )
    {
        for_tick = 1;       //如果总长度小于该位置所在的字节的剩余长度，则就提取一个字节。
    }
    else
    {
        remain_length = length - (8 - start % 8);      //计算剩余长度

        if( remain_length % 8 )
        {
            for_tick = remain_length / 8 + 2;        //如果剩余长度需要跨字节，则所占字节数需要加贰
        }
        else
        {
            for_tick = remain_length / 8 + 1;        //如果剩余长度不需要跨字节，则所占字节数需要加壹
        }
    }

    switch(for_tick)
    {
        case 1:
        {
            Buff_taked = *(Buff + (start / 8));
            break;
        }
        case 2:
        {
            Buff_taked = *(Buff + (start / 8) - 1);
            Buff_taked = (Buff_taked << 8) + *(Buff + (start / 8));
            break;
        }
        case 3:
        {
            Buff_taked = *(Buff + (start / 8) - 2);
            Buff_taked = (Buff_taked << 8) + *(Buff + (start / 8) - 1);
            Buff_taked = (Buff_taked << 8) + *(Buff + (start / 8));
            break;
        }
        case 4:
        {
            Buff_taked = *(Buff + (start / 8) - 3);
            Buff_taked = (Buff_taked << 8) + *(Buff + (start / 8) - 2);
            Buff_taked = (Buff_taked << 8) + *(Buff + (start / 8) - 1);
            Buff_taked = (Buff_taked << 8) + *(Buff + (start / 8));
            break;
        }
        default:
        {
            Buff_taked = 0;
            break;
        }
    }

    Value_Max = (Value_Max << length);

    Value_Max = Value_Max - 1;

    Buff_taked = (Buff_taked >> (start % 8));

    Buff_taked = (Buff_taked & Value_Max);

    return Buff_taked;
}

uint32_t CAN_Get_MsgDataValue(CAN_CHANNEL CanChannel, CHANNEL Channel, uint8_t start, uint8_t length)
{
    uint32_t can_data_temp = 0;

    switch(CanChannel)
    {
        case CAN2:
        {
            can_data_temp = CAN_GetValue(&CAN2_RX_Array[Channel].data.R8[0], start, length);
            break;
        }
        case CAN1:
        {
            can_data_temp = CAN_GetValue(&CAN1_RX_Array[Channel].data.R8[0], start, length);
            break;
        }
        case CAN3:
        {
            can_data_temp = CAN_GetValue(&CAN3_RX_Array[Channel].data.R8[0], start, length);
            break;
        }
        case CAN0:
        {
            can_data_temp = CAN_GetValue(&CAN0_RX_Array[Channel].data.R8[0], start, length);
            break;
        }
        default:
            break;
    }
    return can_data_temp;
}

/*
 * function:	设置值到数组的对应位置,会先清除指定位置的值,后在不干扰其他位置的情况下写入
 *
 * */
uint32_t CAN_SetValue(uint8_t *Buff, uint8_t start, uint8_t length, uint32_t Value)
{
    unsigned char for_tick = 0, remain_length = 0;
    unsigned long Buff_filled = 0;
    unsigned long Value_Max = 1;

    Value_Max = (Value_Max << length);

    Value_Max = Value_Max - 1;

    Buff_filled = Value;

    Buff_filled = Buff_filled & Value_Max;

    Buff_filled = (Buff_filled << (start % 8));

    if( length <= (8 - start % 8) )
    {
        for_tick = 1;       //如果总长度小于该位置所在的字节的剩余长度，则就提取一个字节。
    }
    else
    {
        remain_length = length - (8 - start % 8);      //计算剩余长度

        if( remain_length % 8 )
        {
            for_tick = remain_length / 8 + 2;        //如果剩余长度需要跨字节，则所占字节数需要加贰
        }
        else
        {
            for_tick = remain_length / 8 + 1;        //如果剩余长度不需要跨字节，则所占字节数需要加壹
        }
    }

    switch(for_tick)
    {
        case 1:
        {
            *(Buff + (start / 8)) = *(Buff + (start / 8)) | (Buff_filled & 0xff);
            break;
        }
        case 2:
        {
            *(Buff + (start / 8)) = *(Buff + (start / 8)) | (Buff_filled & 0xff);
            *(Buff + (start / 8) - 1) = *(Buff + (start / 8) - 1) | ((Buff_filled >> 8) & 0xff);
            break;
        }
        case 3:
        {
            *(Buff + (start / 8)) = *(Buff + (start / 8)) | (Buff_filled & 0xff);
            *(Buff + (start / 8) - 1) = *(Buff + (start / 8) - 1) | ((Buff_filled >> 8) & 0xff);
            *(Buff + (start / 8) - 2) = *(Buff + (start / 8) - 2) | ((Buff_filled >> 16) & 0xff);
            break;
        }
        case 4:
        {
            *(Buff + (start / 8)) = *(Buff + (start / 8)) | (Buff_filled & 0xff);
            *(Buff + (start / 8) - 1) = *(Buff + (start / 8) - 1) | ((Buff_filled >> 8) & 0xff);
            *(Buff + (start / 8) - 2) = *(Buff + (start / 8) - 2) | ((Buff_filled >> 16) & 0xff);
            *(Buff + (start / 8) - 3) = *(Buff + (start / 8) - 3) | ((Buff_filled >> 24) & 0xff);
            break;
        }
        default:
        {
            break;
        }
    }

    return Buff_filled;
}

void CAN_Set_MsgDataValue(CAN_CHANNEL CanChannel, CHANNEL Channel, uint8_t start, uint8_t length, uint32_t Value)
{
    switch(CanChannel)
    {
        case CAN2:
        {
            CAN_SetValue(&CAN2_TX_Array[Channel].data.R8[0], start, length, Value);
            break;
        }
        case CAN1:
        {
            CAN_SetValue(&CAN1_TX_Array[Channel].data.R8[0], start, length, Value);
            break;
        }
        case CAN3:
        {
            CAN_SetValue(&CAN3_TX_Array[Channel].data.R8[0], start, length, Value);
            break;
        }
        case CAN0:
        {
            CAN_SetValue(&CAN0_TX_Array[Channel].data.R8[0], start, length, Value);
            break;
        }
        default:
            break;
    }
}

