boolean SendVCU511EventMsg(void)
{
    boolean needResend = FALSE;
#define EVENT_MSG_DELAY 10
    /*according to comm spec, event messsage , should have an interval with previously sent cycle message*/
    if( (SystemTickMs - CAN3_TX_Array[CHANNEL_8].clocktime) < EVENT_MSG_DELAY )
    {
        needResend = TRUE;
    }
    else
    {
        /*interval with next cycle > delay , event Message can be sent, if not don't send it*/
        if( (CAN3_TX_Array[CHANNEL_8].clocktime + CAN3_TX_Array[CHANNEL_8].period - SystemTickMs) > EVENT_MSG_DELAY )
        {
            /*  数据缓存区清除  */
            CAN_Clear_MsgDataValue(CAN3, CHANNEL_8);
            /*  数据缓存区写入  */
            PrepareBTKSignalsForVCU511();

            CAN_Set_MsgDataValue(CAN3, CHANNEL_8, 10, 3, VHALO_ESKGearPosn);/*档杆位置信号*/
            CAN_Set_MsgDataValue(CAN3, CHANNEL_8, 16, 9, VHALO_InstantEnergyConsump);/*瞬时能耗*/
            ///CAN_Set_MsgDataValue(CAN3,CHANNEL_8,40,24,VHALO_VCUHisSubtotalEgyCnse);/*历史总耗电量*/
            CAN_Set_MsgDataValue(CAN3, CHANNEL_8, 56, 9, VHALO_VCUVehEgyCnseDrv);/*平均能耗*/
            CANTransimitRandomMessage(CAN3, &CAN3_TX_Array[CHANNEL_8]);
        }
    }
    return needResend;
#undef EVENT_MSG_DELAY    
}
